import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const HomePageBox_Two = () => {
    return (
        <View style={styles.box_two}>
            <View style={styles.box_two_heading}>
                <Text style={styles.box_two_Style}>Our Staf</Text>
                <Text style={styles.box_two_btn_btnStyle}>Show All</Text>
            </View>
            <View style={styles.box_container}>
                {homeBox_one.map((data) => (
                    <View style={styles.box_container_box}>
                        <Text style={{ backgroundColor: 'green', padding: '10px', borderRadius: '10px' }}>
                            <Image source={data.src} style={styles.home_box_img} />
                        </Text>
                        <Text style={styles.home_box_text}>{data.name}</Text>
                    </View>
                ))}
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    box_two: {
        marginTop: '10%',
        height: '50px',
        width: '100%',
    },
    box_two_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    box_two_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two_btn_btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
})

export default HomePageBox_Two;
